import React from 'react'
import Swiper from 'swiper'
import { Navigation } from 'swiper/modules'
import { SwiperSlide } from 'swiper/react'
import "swiper/css";
export const SwiperView = () => {
  return (
    
    <div>
        <Swiper
        spaceBetween={32}
        slidesPerView={4} 
        navigation={{
          Navigation,
        }}
        modules={[Grid, Navigation]}
        className="mySwiper"
      >
        {product.map((p) => {
          return (
            <SwiperSlide>
              <ModelItem
                key={p.id}
                name={p.name}
                title={p.title}
                id={p.id}
                sale={p.sale}
                cost={p.cost}
              />
            </SwiperSlide>
          );
        })}
      </Swiper>
  </div>
  )
}
